import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Image, TouchableOpacity, TextInput, FlatList, Button, KeyboardAvoidingView, Modal, Pressable, Linking } from 'react-native';
import React, { useState, useEffect } from 'react';
import {NavigationContainer} from '@react-navigation/native';
import {createBottomTabNavigator} from '@react-navigation/bottom-tabs';
import { FontAwesome } from '@expo/vector-icons'; 
import { FontAwesome5 } from '@expo/vector-icons';
import * as Location from 'expo-location';
import ModalDropdown from 'react-native-modal-dropdown';

export default function App() {

  const Tab = createBottomTabNavigator();

  // const [location, setLocation] = useState(null)

  return (
    <NavigationContainer>
      <Tab.Navigator
        tabBarLabelStyle={styles.tabBarLabelStyle}>

        <Tab.Screen 
          name="Check In" 
          component={CheckIn}
          // location={location}
          // setLocation={()=>{setLocation}}
          options={{
            tabBarIcon: ({ color, size }) => (
              <FontAwesome5 name="user-check" size={24} color="#7D1516" />
            )
          }}
          />
        <Tab.Screen 
          name="Calendar" 
          component={Calendar} 
          options={{
            tabBarIcon: ({ color, size }) => (
              <FontAwesome name="calendar" size={24} color="#7D1516" />
            )
          }}
         />
      </Tab.Navigator>
    </NavigationContainer>
  );
}

function CheckIn(props) {
  const options = ['Shabbat', 'Sports Grille', 'Hoosiers for Israel', 'Antisemetism Task Force', 'Challah for Hungry Hoosiers', 'Student Leadership Dinner', 'GJC', 'Other']

  const [firstName, onChangeFirstName] = useState("")
  const [LastName, onChangeLastName] = useState("")
  const [phoneNumber, onChangePhoneNumber] = useState("")
  const [email, onChangeEmail] = useState("")
  const [showAlert, setShowAlert] = useState(false)
  const [selection, setSelection] = useState("")
  const [otherEvent, onChangeOtherEvent] = useState("")
  const [other, setOther] = useState(false)

  const [location, setLocation] = useState(null)
  const [latitude, setLatitude] = useState(null)
  const [longitude, setLongitude] = useState(null)

  useEffect(() => {
    (async() => {
      let {status} = await Location.requestForegroundPermissionsAsync()

      if (status !== 'granted') {
        console.log("Location is not permitted")
      }

      let results = await Location.getCurrentPositionAsync({})
      setLocation(results)
      setLatitude(results.coords.latitude)
      setLongitude(results.coords.longitude)
    }) ()
  }, [])

  useEffect(() => {
    if (selection == 'Other') {
      setOther(true)
    } else {
      setOther(false)
    }
  }, [selection])

  const OpenWEB = (url) => {
    Linking.openURL(url);
  };

  if (location != null) {
    if ((latitude - 39.1637037 < Math.abs(.0005)) && (longitude - -86.5243636 < Math.abs(.0005))) {
      return(
        <View style={styles.checkin}>
          <TextInput 
            style={styles.input}
            onChangeText={onChangeFirstName}
            value={firstName}
            placeholder="First Name"
            autoCapitalize="words"
            />
          <TextInput 
            style={styles.input}
            onChangeText={onChangeLastName}
            value={LastName}
            placeholder="Last Name"
            autoCapitalize="words"
            />
          <TextInput 
            style={styles.input}
            onChangeText={onChangePhoneNumber}
            value={phoneNumber}
            placeholder="Phone Number"
            keyboardType="numeric"
            />
          <TextInput 
            style={styles.input}
            onChangeText={onChangeEmail}
            value={email}
            placeholder="Email"
            keyboardType='email-address'
            />
          <ModalDropdown 
            style={styles.dropdown}
            textStyle={styles.textStyle}
            defaultValue="Select the Event"
            dropdownTextStyle={styles.dropdownText}
            dropdownStyle={styles.dropdownMenu}
            onSelect={(value) => {setSelection(options[value])}}
            options={options}
            />
          {other && <TextInput 
            style={styles.input}
            onChangeText={onChangeOtherEvent}
            value={otherEvent}
            placeholder="Event Name"
            autoCapitalize="words"
            />}
          <View style={styles.signinView}>
            <Button 
              style={styles.signInButton}
              onPress={() => {setShowAlert(true)
                              console.log(LastName, firstName, phoneNumber, email, selection)}}
              title='Sign in'
              color="#4C4D4F"
              />
          </View>
            <Modal
             transparent={true}
             visible={showAlert}
             animationIn="slideInLeft"
             animationOut="slideOutRight">
             <View
               style={{
                 backgroundColor: 'rgba(0,0,0,.75)',
                 alignItems: 'center',
                 justifyContent: 'center',
                 flex: 1,
               }}>
               <View
                 style={{
                   width: '90%',
                   backgroundColor: 'white',
                   padding: 22,
                   justifyContent: 'center',
                   alignItems: 'center',
                   borderRadius: 4,
                   borderColor: 'rgba(0, 0, 0, 0.1)',
                 }}>
                 <Text style={styles.alertText}>Thank you for signing in!  Welcome to Hillel!</Text>
                 <Button
                   onPress={() => { setShowAlert(false) }}
                   title="Close"
                   color="#4C4D4F"
                 />
               </View>
             </View>
           </Modal>
        </View>
      )
    } else {
      return(
        <View style={styles.notThereWrapper}>
          <View style={styles.notAtHillel}>
            <Text style={styles.topText}> You should go to hillel for an event. Check out our socials below to see when events are! </Text>
            <View style={styles.logoBox}>
              <TouchableOpacity
                onPress={() => {OpenWEB('https://www.instagram.com/iuhillel/')}}>
                {/* <Text style={styles.links}>This is a link to the instagram!</Text> */}
                <Image 
                  style={styles.logos}
                  source={{uri: "https://cdn-icons-png.flaticon.com/512/174/174855.png"}}/>
              </TouchableOpacity>
              <TouchableOpacity
                onPress={() => {OpenWEB('https://iuhillel.org/')}}>
                {/* <Text style={styles.links}>This is a link to the website!</Text> */}
                <Image 
                  style={styles.hillelLogo}
                  source={{uri: "https://images.squarespace-cdn.com/content/v1/5af073021137a6e43168fb45/1555440983580-9DEDIZ8JOR60NA4P899S/Hillel+logo+tint.png?format=1500w"}}/>
              </TouchableOpacity>
              <TouchableOpacity
                onPress={() => {OpenWEB('https://www.tiktok.com/@iuhillel?is_from_webapp=1&sender_device=pc')}}>
                {/* <Text style={styles.links}>This is a link to the TikTik!</Text> */}
                <Image 
                  style={styles.logos}
                  source={{uri: "https://assets.stickpng.com/images/602179070ad3230004b93c28.png"}}/>
              </TouchableOpacity>
            </View>
          </View>
        </View>

      )
    }
  }
}

function Calendar(props) {
  const [calendarData, setCalendarData] = useState([])
  const [eventStartTime, setEventStartTime] = useState(null)

  const eventArray = []

  async function getCalendarEvents() {
    const response = await fetch(`https://www.googleapis.com/calendar/v3/calendars/c_c6ia07rt9f47ihk3pdmbp8dh14%40group.calendar.google.com/events?key=AIzaSyBu8rk6LccXFaX5rUHzDibDWeTuUOWiRJ4`, {
      headers: {
        "Accept": "application/json",
      }
    });
    const json = await response.json();

    // setCalendarData(json.items)

    const eventList = json.items

    const dateParsed = new Date().getTime()    

    // console.log(date)

    eventList.forEach((item, index) => {
      let eventObject= {
        summary: item.summary?item.summary:"",
